  CEF7F6812AEEDCC400E34952:
    buildActionMask: '2147483647'
    files: []
    inputFileListPaths: []
    inputPaths:
    - $(SRCROOT)/Platform/iOS/Settings.bundle
    isa: PBXShellScriptBuildPhase
    name: Patch Settings bundle
    outputFileListPaths: []
    outputPaths:
    - $(TARGET_BUILD_DIR)/$(CONTENTS_FOLDER_PATH)/Settings.bundle/Root.plist
    runOnlyForDeploymentPostprocessing: '0'
    shellPath: /bin/sh
    shellScript: "#!/bin/sh\n\nPLISTBUDDY=/usr/libexec/PlistBuddy\nROOT_PLIST=\"$SCRIPT_OUTPUT_FILE_0\"\
      \n\nCOUNT=$($PLISTBUDDY -c \"Print :PreferenceSpecifiers\" \"$ROOT_PLIST\" |\
      \ grep -c '^    }$')\n\nfor ((i = 0; i < COUNT; i++)); do\n    remove=0\n  \
      \  platform=$($PLISTBUDDY -c \"Print :PreferenceSpecifiers:$i:Platform\" \"\
      $ROOT_PLIST\" 2> /dev/null)\n    if [ ! -z \"$platform\" ]; then\n        if\
      \ [ \"$platform\" == \"$PLATFORM_FAMILY_NAME\" ]; then\n            echo \"\
      Found entry $i for $platform\"\n            $PLISTBUDDY -c \"Delete :PreferenceSpecifiers:$i:Platform\"\
      \ \"$ROOT_PLIST\"\n        else\n            echo \"Exclude $i due to Platform\"\
      \n            remove=1\n        fi\n    fi\n    excludetargets=$($PLISTBUDDY\
      \ -c \"Print :PreferenceSpecifiers:$i:ExcludeTargets\" \"$ROOT_PLIST\" 2> /dev/null\
      \ | sed '1d;$d' | xargs)\n    if [ ! -z \"$excludetargets\" ]; then\n      \
      \  found=0\n        for target in $excludetargets; do\n            if [ \"$target\"\
      \ == \"$TARGET_NAME\" ]; then\n                found=1\n            fi\n   \
      \     done\n        if [ $found -eq 1 ]; then\n            echo \"Exclude $i\
      \ due to ExcludeTargets\"\n            remove=1\n        else\n            echo\
      \ \"Found entry $i for ExcludeTargets\"\n            $PLISTBUDDY -c \"Delete\
      \ :PreferenceSpecifiers:$i:ExcludeTargets\" \"$ROOT_PLIST\"\n        fi\n  \
      \  fi\n    if [ $remove -eq 1 ]; then\n        echo \"Removing entry $i\"\n\
      \        $PLISTBUDDY -c \"Delete :PreferenceSpecifiers:$i\" \"$ROOT_PLIST\"\n\
      \        ((COUNT--))\n        ((i--))\n    fi\ndone\n"
    showEnvVarsInLog: '0'
